import styled from 'styled-components';
import { Link } from 'react-router-dom';

export const LinkHome = styled(Link)`
display: block;
width: 4em;
text-align: center;
margin: 2em auto;
background: .5em 0;
color: #fff;
text-decoration: none;
`;
